Sway supports unused generic type parameters when declaring structs/enums: struct SomeStruct<T, K> { field: u64
} enum SomeEnum<T, K> { One: u64
} If you tried the same in Rust you'd get complaints that T and K must be used or removed. When generating Rust bindings for such types we make use of the PhantomData type. The generated bindings for the above example would look something like this: struct SomeStruct<T, K> { pub field: u64, pub _unused_generic_0: PhantomData<T> pub _unused_generic_1: PhantomData<K>
} enum SomeEnum<T, K> { One(u64), IgnoreMe(PhantomData<T>, PhantomData<K>)
} To lessen the impact to developer experience you may use the new method to initialize a structure without bothering with the PhantomDatas.: assert_eq!( <StructUnusedGeneric<u16, u32>>::new(15), StructUnusedGeneric { field: 15, _unused_generic_0: std::marker::PhantomData, _unused_generic_1: std::marker::PhantomData } ); If your struct doesn't have any fields we'll also derive Default. As for enums all PhantomDatas are placed inside a new variant called IgnoreMe which you'll need to ignore in your matches: match my_enum { EnumUnusedGeneric::One(_value) => {} EnumUnusedGeneric::IgnoreMe(..) => panic!("Will never receive this variant"), }

